import React, {useContext} from 'react'
import {UserContext} from '../App'

export default function Card() {
    const state = useContext(UserContext);
    const Data = state.CurrentCard
    console.log(state.CurrentCard)
    const fun = () => {
        alert("hello")
    }
  return (
    <div className='Card' onClick={fun}>
          <p className='Bank-Name'>{Data.Bank_Name}</p>
          <p className='Debit-Card-No'>{Data.Card_No}</p>
          <div style={{backgroundColor:"black", height:"15%"}}></div>
          <p className='Card-details'>
            <span className='Holder-Name'>{Data.Name}</span>
            <span className='Expire-Date'>{Data.Expire}</span>
            <span className='CVV'>{Data.Cvv}</span>
          </p>
        </div>
  )
}
